import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { Route } from 'react-router-dom';

ReactDOM.render(
	<React.StrictMode>
		<Route path='/' component={App}></Route>
	</React.StrictMode>,
	document.getElementById('root')
);
